            <div className="modal-body">
              {exportData && (
                <div className="export-summary">
                  <h4>Export Summary:</h4>
                  <div className="export-stats">
                    <p>Total Patterns: {exportData.statistics.total_patterns}</p>
                    <p>Flagged Patterns: {exportData.statistics.flagged_patterns}</p>
                    <p>Total Suggestions: {exportData.statistics.total_suggestions}</p>
                    <p>Applied Suggestions: {exportData.statistics.applied_suggestions}</p>
                    <p>Total Feedback: {exportData.statistics.total_feedback}</p>
                    <p>Feedback Accuracy: {typeof exportData.statistics.feedback_accuracy === 'number' ? exportData.statistics.feedback_accuracy.toFixed(1) + '%' : 'N/A'}</p>
                  </div>
                  <button onClick={downloadExportData} className="btn-primary">
                    Download JSON
                  </button>
                </div>
              )}
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default PatternLearningFeedback;
